import React, { useState } from 'react';

function App() {
  const [users, setUsers] = useState([]);
  const [registerData, setRegisterData] = useState({ username: '', password: '' });
  const [loginData, setLoginData] = useState({ username: '', password: '' });
  const [loggedInUser, setLoggedInUser] = useState(null);
  const [error, setError] = useState('');
  const [screen, setScreen] = useState('login'); // 'login' | 'register' | 'welcome'

  // Registro de usuario
  const handleRegister = (e) => {
    e.preventDefault();
    if (users.find(u => u.username === registerData.username)) {
      setError('El usuario ya existe');
      return;
    }
    setUsers([...users, registerData]);
    setRegisterData({ username: '', password: '' });
    setError('');
    alert('Usuario registrado correctamente');
    setScreen('login');
  };

  // Login de usuario
  const handleLogin = (e) => {
    e.preventDefault();
    const user = users.find(
      u => u.username === loginData.username && u.password === loginData.password
    );
    if (user) {
      setLoggedInUser(user.username);
      setLoginData({ username: '', password: '' });
      setError('');
      setScreen('welcome');
    } else {
      setError('Usuario o contraseña incorrectos');
    }
  };

  // Logout
  const handleLogout = () => {
    setLoggedInUser(null);
    setScreen('login');
  };

  return (
    <div style={{ maxWidth: 400, margin: 'auto', padding: 20 }}>
      <h1>Curso de Testing</h1>
      {screen === 'register' && (
        <>
          <h2>Registro</h2>
          <form onSubmit={handleRegister}>
            <input
              type="text"
              placeholder="Usuario"
              value={registerData.username}
              onChange={e => setRegisterData({ ...registerData, username: e.target.value })}
              required
            />
            <br />
            <input
              type="password"
              placeholder="Contraseña"
              value={registerData.password}
              onChange={e => setRegisterData({ ...registerData, password: e.target.value })}
              required
            />
            <br />
            <button type="submit">Registrar</button>
          </form>
          <button onClick={() => { setScreen('login'); setError(''); }}>Ir a Login</button>
          {error && <p style={{ color: 'red' }}>{error}</p>}
        </>
      )}

      {screen === 'login' && (
        <>
          <h2>Login</h2>
          <form onSubmit={handleLogin}>
            <input
              type="text"
              placeholder="Usuario"
              value={loginData.username}
              onChange={e => setLoginData({ ...loginData, username: e.target.value })}
              required
            />
            <br />
            <input
              type="password"
              placeholder="Contraseña"
              value={loginData.password}
              onChange={e => setLoginData({ ...loginData, password: e.target.value })}
              required
            />
            <br />
            <button type="submit">Ingresar</button>
          </form>
          <button onClick={() => { setScreen('register'); setError(''); }}>Ir a Registro</button>
          {error && <p style={{ color: 'red' }}>{error}</p>}
        </>
      )}

      {screen === 'welcome' && loggedInUser && (
        <div>
          <h2>Bienvenido, {loggedInUser}!</h2>
          <button onClick={handleLogout}>Cerrar sesión</button>
        </div>
      )}
    </div>
  );
}

export default App;
